import logo from '../logo.svg';
import '../App.css';

function App() {
  return (
    <div className="App">
      <header className="Ho-header">
        <img src={logo} className="Home-logo" alt="logo" />
        <a href="http://localhost:5000/auth/google">Sign in with Google</a>
      </header>
    </div>
  );
}

export default Home;
